import React, { useEffect } from "react";
import LandingPage from "./pages/LandingPage";
import LoginPage from "./pages/LoginPage";
import RegisterPage from "./pages/RegisterPage";
// import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import store from "./store"; // allows us to connect redux with react
import { Provider } from "react-redux"; // allows us to connect store to our routes
import setAuthenticationToken from "./middleware/setAuthenticationToken"; //grabs middleware for grabbing token
import { userLoaded } from "./actions/auth.actions";
import Dashboard from "./pages/Dashboard";
import Friends from "./pages/Friends";
import InputRecipe from "./pages/InputRecipe";
import Login from "./pages/Login";
import SearchPage from "./pages/SearchPage";
import Wrapper from "./components/Wrapper";
import Recipes from "./pages/Recipes";
import SingleRecipe from "./pages/SingleRecipe";
import Profile from "./pages/Profile";


if (localStorage.getItem("token")) {
  setAuthenticationToken(localStorage.getItem("token"));
}
const App = () => {
  useEffect(() => {
    store.dispatch(userLoaded());
  }, []);
  return (
    <Router>
      <Provider store={store}>
      <Route exact path="/" component={Login} />
      <Route exact path="/login" component={Login} />
        <Wrapper />
        <Switch>
          <Route path="/landingpage" exact component={LandingPage} />
          <Route path="/register" exact component={RegisterPage} />
          <Route path="/login" exact component={LoginPage} />
          <Route exact path="/Dashboard/id:/" component={Dashboard} />
          <Route exact path="/Dashboard/id:/searchpage" component={SearchPage} />
          <Route exact path="/Dashboard/id:/friends" component={Friends} />
          <Route exact path="/Dashboard/id:/inputrecipe" component={InputRecipe} />
          <Route exact path="/Dashboard/id:/recipes" component={Recipes} />
          <Route exact path="/Dashboard/id:/singlerecipe/id:/" component={SingleRecipe} />
          <Route exact path="/Dashboard/id:/profile/id:/" component={Profile} />
        </Switch>
        <Footer />
      </Provider>
    </Router>
  );
};

